import React, { Component } from 'react';
import axios from 'axios';

export default class KnnScreen extends Component {
  constructor(props) {
    super(props);

    this.knn = this.knn.bind(this);
  }

  async knn() {
    await axios.get('http://localhost:5000/knn/')
      .then(res => {
        console.log(res);
      })
      .catch(err => {
        console.log(err);
      });
  }

  render() {
    return (
      <div style={styles.main}>
        <h2>K-Nearest-Neighbor (KNN)</h2>
        <hr />
        <p>The KNN algorithm.</p>
        <button onClick={this.knn}>KNN</button>
      </div>
    );
  }
}

const styles = {
  main: {
    width: 800,
    display: "inline-block",
    marginTop: 100,
    padding: 40,
    color: "rgb(0, 61, 112)",
    backgroundColor: "rgb(193, 227, 255)",
    borderRadius: 7
  }
};
